# process-mrva-results 0.0.1
extensions:
- addsTo:
    extensible: typeModel
    pack: codeql/python-all
  data:
  - - pydantic.BaseModel~Subclass
    - fastapi_auth0
    - Member[Auth0User]
  - - pydantic.BaseModel~Subclass
    - fastapi_auth0
    - Member[auth].Member[Auth0User]
  - - pydantic.BaseModel~Subclass
    - fastapi_auth0
    - Member[auth].Member[HTTPAuth0Error]
  - - pydantic.BaseModel~Subclass
    - fastapi_auth0
    - Member[auth].Member[HTTPAuthorizationCredentials]
  - - pydantic.BaseModel~Subclass
    - fastapi_auth0
    - Member[auth].Member[OAuthFlowImplicit]
  - - pydantic.BaseModel~Subclass
    - fastapi_auth0
    - Member[auth].Member[OAuthFlows]
